CREATE DATABASE TicketManagementDatabase
USE TicketManagementDatabase

create table [Planes] (
  [Id] INT,
  [Name] VARCHAR(50),
  [Make] VARCHAR(50),
  [Model] VARCHAR(50)
);





create table [Customers] (
                             [Id] INT,
                             [FirstName] VARCHAR(50),
                             [LastName] VARCHAR(50),
                             [Country] VARCHAR(50),
                             [Age] INT
);




create table [Tickets] (
                           Id INT,
                           [From] VARCHAR(50),
                           [To] VARCHAR(50),
                           DepartureTime DATE,
                           ArrivalTime DATE,
                           SeatNumber INT,
                           PlaneId INT,
                           CustomerId INT
);

